jQuery(document).ready(function($){$.ajax({url:"get_twitter_users.php",type:"GET",success:function(r){if("undefined"==typeof r.errors||r.errors.length<1){var e=$("#partner_org_social");$.each(r,function(r,t){e.append("<li>"+t.text+"</li>")}),$("#partner_org_social").html(e)}else $("#partner_org_social p:first").text("Response error")},error:function(r){$("#partner_org_social p:first").text("Request error")}})});